767	$2x^3-5x^2+ax+b$ gives no remainder when divided by $(2x-1)$ but gives the remainder $15$ when divided by $(x+1)$.$\\\\[2pt]$\r\n(a) $\\quad$ Find the value of $a$ and $b$.  $\\\\[2pt]$\r\n(b) $\\quad$ Hence or otherwise, solve $0=2x^3-5x^2+ax+b$. 	Part (a)$\\\\[2pt]$\r\nLet $f(x)=2x^3-5x^2+ax+b$\r\n\\begin{align*}\r\nf\\left(\\frac{1}{2}\\right)&=0\\\\[2pt]\r\n2\\left(\\frac{1}{2}\\right)^3-5\\left(\\frac{1}{2}\\right)^2+a\\left(\\frac{1}{2}\\right)+b&=0\\\\[2pt]\r\n\\frac{1}{4}-\\frac{5}{4}+\\frac{a}{2}+b&=0\\\\[2pt]\r\n\\frac{a}{2}+b&=1\\qquad (1)\\\\[20pt]\r\nf(-1)&=15\\\\[2pt]\r\n2(-1)^3-5(-1)^2+a(-1)+b&=15\\\\[2pt]\r\n-2-5-a+b&=15\\\\[2pt]\r\n-a+b&=22 \\qquad (2)\\\\[10pt]\r\n(1)-(2) \\qquad \\left(\\frac{a}{2}+b\r\n\\right)-\\left(-a+b\\right)&=1-22\\\\[2pt]\r\n\\frac{3a}{2}&=-21\\\\[2pt]\r\na&=-14\r\n\\end{align*}\r\nSub $a=-14$ into (2)\r\n\\begin{align*}\r\n-(-14)+b&=22\\\\[2pt]\r\nb&=8\r\n\\end{align*}\r\n$a=-14 \\qquad b=8$$\\\\[2pt]$\r\n$\\underline{\\hspace{500pt}}\\\\[10pt]$\r\nPart (b)$\\\\[2pt]$\r\n\\begin{align*}\r\n0&=2x^3-5x^2-14x+8\\\\[2pt]\r\n0&=(2x-1)(x^2+kx-8) \\qquad -5x^2=2kx^2-x^2 \\qquad \\Rightarrow \\qquad k=-2\\\\[2pt]\r\n0&=(2x-1)(x^2-2x-8) \\qquad P=2 \\qquad S=-3\\\\[2pt]\r\n0&=(2x-1)(x-4)(x+2) \\qquad (-2,-1)\r\n\\end{align*}\r\n$x=0.5,4,-2$\r\n	2016-11-11 16:03:47.140991	2016-11-11 22:59:15.986708	1	90	e1	\N	\N	\N	\N	\N	\N	\N	\N
