700	A curve has equation $f(x)=\\displaystyle\\frac{4}{x}+x+2, x>0$, find the equation of the normal to the curve which is perpendicular to $9y-5x+10=0$, give the equation of the normal in the form $y=mx+c$ and state the values of $m$ and $c$.	\\begin{align*}\r\nf'(x)=-4x^{-2}+1\r\n\\end{align*}\r\n$\\hspace{406pt} 9y-5x+10=0 $ $\\\\[2pt]$\r\nnormal grad $=-\\displaystyle\\frac{1}{f'(x)} \\hspace{314pt} 9y=5x-10$$\\\\[2pt]$\r\n$\\hspace{50pt} =-\\displaystyle\\frac{1}{-4x^{-2}+1}\\hspace{288pt} y=\\displaystyle\\frac{5}{9}x-\\frac{10}{9}$$\\\\[2pt]$\r\n$\\hspace{406pt} \\Rightarrow \\qquad m=\\displaystyle\\frac{5}{9}$$\\\\[10pt]$\r\nPerpendicular $\\qquad \\Rightarrow$\r\n\\begin{align*}\r\n\\frac{5}{9}\\left(-\\displaystyle\\frac{1}{-4x^{-2}+1}\\right)&=-1\\\\[2pt]\r\n\\frac{5}{9(-4x^{-2}+1)}&=1\\\\[2pt]\r\n5&=-36x^{-2}+9\\\\[2pt]\r\n-4&=-36x^{-2}\\\\[2pt]\r\n\\frac{1}{9}&=x^{-2}\\\\[2pt]\r\nx&=3\r\n\\end{align*}\r\n$\\,$$\\\\[10pt]$\r\n$x=3 \\qquad \\Rightarrow \\qquad f(x)=\\displaystyle\\frac{4}{3}+3+2=\\displaystyle\\frac{19}{3}\\qquad \\Rightarrow \\qquad \\left(3,\\displaystyle\\frac{19}{3}\\right) $$\\\\[2pt]$\r\n$x=3 \\qquad \\Rightarrow \\qquad -\\displaystyle\\frac{1}{f'(x)}=-\\displaystyle\\frac{1}{-4(3)^{-2}+1}=-\\frac{9}{5} \\qquad m=-\\frac{9}{5}$$\\\\[2pt]$\r\nNormal\r\n\\begin{align*}\r\ny-\\frac{19}{3}&=-\\frac{9}{5}(x-3)\\\\[2pt]\r\ny-\\frac{19}{3}&=-\\frac{9}{5}x+\\frac{27}{5}\\\\[2pt]\r\ny&=-\\frac{9}{5}x+\\frac{176}{15}\\\\[2pt]\r\ny&=-1.8x+11.73\r\n\\end{align*}\r\n$m=-1.8, \\qquad c=11.73$\r\n\r\n	2016-10-28 14:10:06.753373	2016-11-04 14:57:15.145589	1	55	a018	\N	\N	\N	\N	\N	\N	\N	\N
