701	A curve has equation $f(x)=\\displaystyle\\frac{3}{x}-x+1, x>0$, find the equation of the normal to the curve which is perpendicular to $4y+7x+1=0$, give the equation of the normal in the form $y=mx+c$ and state the values of $m$ and $c$.	\\begin{align*}\r\nf'(x)=-3x^{-2}-1\r\n\\end{align*}\r\n$\\hspace{406pt} 4y+7x+1=0 $ $\\\\[2pt]$\r\nnormal grad $=-\\displaystyle\\frac{1}{f'(x)} \\hspace{314pt} 4y=-7x-1$$\\\\[2pt]$\r\n$\\hspace{50pt} =-\\displaystyle\\frac{1}{-3x^{-2}-1}\\hspace{289pt} y=-\\displaystyle\\frac{7}{4}x-\\frac{1}{4}$$\\\\[2pt]$\r\n$\\hspace{406pt} \\Rightarrow \\qquad m=-\\displaystyle\\frac{7}{4}$$\\\\[10pt]$\r\nPerpendicular $\\qquad \\Rightarrow$\r\n\\begin{align*}\r\n-\\frac{7}{4}\\left(-\\displaystyle\\frac{1}{-3x^{-2}-1}\\right)&=-1\\\\[2pt]\r\n\\frac{7}{4(-3x^{-2}-1)}&=-1\\\\[2pt]\r\n7&=4(3x^{-2}+1)\\\\[2pt]\r\n7&=12x^{-2}+4\\\\[2pt]\r\n3&=12x^{-2}\\\\[2pt]\r\n\\frac{1}{4}&=x^{-2}\\\\[2pt]\r\nx&=2\r\n\\end{align*}\r\n$\\,$$\\\\[10pt]$\r\n$x=2 \\qquad \\Rightarrow \\qquad f(x)=\\displaystyle\\frac{3}{2}-2+1=\\displaystyle\\frac{1}{2}\\qquad \\Rightarrow \\qquad \\left(2,\\displaystyle\\frac{1}{2}\\right) $$\\\\[2pt]$\r\n$x=2 \\qquad \\Rightarrow \\qquad -\\displaystyle\\frac{1}{f'(x)}=-\\displaystyle\\frac{1}{-3(2)^{-2}-1}=4 \\qquad m=\\frac{4}{7}$$\\\\[2pt]$\r\nNormal\r\n\\begin{align*}\r\ny-\\frac{1}{2}&=\\frac{4}{7}(x-2)\\\\[2pt]\r\ny-\\frac{1}{2}&=\\frac{4}{7}x-\\frac{8}{7}\\\\[2pt]\r\ny&=\\frac{4}{7}x-\\frac{9}{14}\\\\[2pt]\r\ny&=0.57x-0.64\r\n\\end{align*}\r\n$m=57, \\qquad c=-0.64$\r\n\r\n	2016-10-28 14:10:06.762929	2016-11-10 12:05:08.04799	1	55	a018	\N	\N	\N	\N	\N	\N	\N	\N
